import React from 'react';
import ReactDOM from 'react-dom';


const elem = (
  <div>
    <h3>List of deals</h3>
    <input placeholder = 'search' />
    <ul>
      <li>Do something</li>
      <li>Do something else</li>
    </ul>
  </div>
);


ReactDOM.render(elem, document.getElementById('root'));
